import "./App.css";
import "animate.css";
import React, { Component } from "react";
import {
  BrowserRouter,
  Routes,
  Route,
  NavLink,
  Link,
  Router,
  HashRouter,
} from "react-router-dom";
import Navbar from "./Components/Navbar/Navbar";
import Header from "./Components/Header/Header";
import M1L1 from "./Components/Lessons/M1L1";
import M1L2 from "./Components/Lessons/M1L2";
import GitHub from "./Components/Lessons/GitHub";
import Grid from "@mui/material/Grid";
function App(props) {
  return (
    <HashRouter>
      <Grid container className="App">
        <Header />
        <div className="Main">
          <Grid item xs={2} md={2} className="navbarBox">
            <Navbar />
          </Grid>

          <Grid item xs={6} className="mainTextBox">
            <Routes>
              <Route path="GitHub" element={<GitHub />} />
              <Route path="M1L1" element={<M1L1 />} />
              <Route path="M1L2" element={<M1L2 />} />
            </Routes>
          </Grid>
        </div>
      </Grid>
    </HashRouter>
  );
}

export default App;
